import '../node_modules/bootstrap/dist/css/bootstrap.min.css';

import { render } from "react-dom";
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";

const root = ReactDOM.createRoot(document.getElementById('root'));


render(
  <BrowserRouter>
    <Routes>
      <Route path="/cat" element= {<App/>}>

      </Route>
    </Routes>

  </BrowserRouter>
)
